import React from 'react';
import Welcome from '../../Welcome';
import VideoGrid from '../../VideoGrid';
import {homeObjFour, homeObjOne, homeObjTwo, gridObjOne, gridObjTwo} from './Data';
import './Interests.css';


function Interests() {
    return (
        <>  
            <section>
                <div className="header-container">
                    <img className="flower-background" src="../../images/sfFlower2.jpg" alt="flowers"/>
                    <div className="header-text-wrapper">
                        <h1>
                            Wuss Hannin'
                        </h1>
                        <h3>
                            its a beautiful obsession
                        </h3>
                    </div>
                    

                </div>
            </section>
            <Welcome {...homeObjOne} />
            <Welcome {...homeObjFour} />
            <VideoGrid {...gridObj}/>
            <Welcome {...homeObjTwo} />
        </>
    );
}

export default Interests;
